import React from 'react';

const RecipeCard = () => {
  return <div>Recipe Card</div>;
  // Define styles as a JavaScript object
  const cardStyles = {
    border: '1px solid #ccc',
    borderRadius: '8px',
    padding: '16px',
    margin: '16px',
    backgroundColor: '#f9f9f9',
    boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
  };

  const titleStyles = {
    fontSize: '1.5rem',
    marginBottom: '8px',
    color: '#333',
  };

  const descriptionStyles = {
    fontSize: '1rem',
    color: '#666',
  };

  return (
    <div style={cardStyles}>
      <h2 style={titleStyles}>Recipe Title</h2>
      <p style={descriptionStyles}>This is a description of the recipe.</p>
    </div>
  );
};

export default RecipeCard;
